import React, { useState } from 'react';
import Staffnavbar from "./Staffnavbar";

const AddCourse = () => {
  const[email,setEmail]=useState("");
  const[password,setPassword]=useState("");
  const[confirmpass,setConformpass]=useState("");

  let handleLogin=()=>{
    alert(email);
    alert(password);
  }
  return (
  <>
    <Staffnavbar/>
    <div className='form-wrapper'>
    <h3 style={{color:"#28a745", textAlign:"center",fontSize:"2vw",padding:'0px',margin:'0px',fontWeight:"500"}}>Add Course</h3>
         <p className='form-label'>Course Name</p>
         <input className='course-form-input' type='text' value={email} onChange={(event=>setEmail(event.target.value))}/>
         <p className='form-label'>Description</p>
         <textarea rows = "5" className='course-form-textfield' type='password' value={password} onChange={(event=>setPassword(event.target.value))}/>
         <p className='form-label'>Choose test</p>
         <select data-placeholder="Begin typing a name to filter..." className='course-form-input' type='' value={confirmpass} onChange={(event=>setConformpass(event.target.value))}>
           <option>CSS</option>
           <option>SCRIPT</option>
           <option>COM</option>
           <option>jQuery</option>
           <option>HTML5</option>
         </select>
         <button className='form-button' onClick={handleLogin}>Login</button>
    </div>
  </>
  )
}

export default AddCourse
